import React from 'react';
import { Link } from 'react-router-dom';
import "../../css/Views/home.css"
import Footer from '../Components/Footer';
import Header from '../Components/Header';

 class Home extends React.Component {

    constructor(props){
        super(props)
        this.state={
        }
    }

    



    render() {
      return (
        <div id="home">
            <Header/>
            <div id="transpBlock">
                <div id="transpBox">
                <svg width="304" height="1157" viewBox="0 0 304 1157" fill="none" xmlns="http://www.w3.org/2000/svg">
<rect width="304" height="1157" fill="url(#pattern0)"/>
<defs>
<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
<use transform="scale(0.00328947 0.000864304)"/>
</pattern>
<image id="image0" width="304" height="1157"/>
</defs>
                </svg>
                </div>
            </div>
            <div id="buttonBlock">
              <Link id="link" to="/equip">
                  <div id="blueButton">
                      <p id="buttonTxt">Commencer</p>
                  </div>
              </Link>
            </div>
            <Footer/>
        </div>
      )
    }
  }

  export default Home
